import '../App.css'
import '../bootstrap.min.css'
import React, { useState } from "react";

function Painting(props) {
    return (
        <div className={props.class}>
            <img className={"painting"} src={props.cover}><p className={"text-white titulo"}>
                <div>
                    <h4 className={"nunito"}>{props.name}</h4>
                    <p className={"nunito"}>{props.artist}</p>
                </div>
            </p></img>



        </div>
    );
}

export default Painting
